import React from 'react';
import logo from './assets/logo.svg';
import './styles.css';

const Home = () => {
    return (
    <div id="page-home">
        <div className="content">
            <header>
                <img src={logo} alt="Ecoleta"/>
            </header>

            <main>
                <h1>Seu marketplace de coleta de resíduos</h1>
                <p>Ajudamos pessoas a encontrar pontos de coleta de uma forma eficiênte</p>
            </main>
        </div>
    </div>
    )
}

export default Home;
